import React from 'react';
import { Fragment } from 'react';

function DataImportation() {
    return (
      <div className='DataImportation'>
       <Fragment>
          <div class="container">
            <button id="relation">Gerar Relat√≥rio</button>
          </div>
          <div id="result"></div>
       </Fragment>
      </div>
    );
  }

  document.getElementById('relation').addEventListener('click', loadTxt);

  function loadTxt(){
    fetch('AFD.txt')
    .then(function(response){
      return response.text();
    })
    .then(function(relation){
      console.log(relation);
      document.getElementById('result').innerHTML = relation;
    })
    .catch(function(error){
      console.log(error)
    })
  }

  export default DataImportation;
